import React from "react";

function StopButtonHandler ({buttonDisable, setButtonDisable}) {
    const handleClick = () => {
        setButtonDisable()
    };

    return (
        <button
        type="button"
        className="btn btn-secondary"
        data-testid="stop"
        title="Stop the session"
        onClick={handleClick}
        >
            <span className="oi oi-media-stop" />
        </button>
    );
}

export default StopButtonHandler;
